import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, FormGroup, FormLabel, FormControl, FormText, Container, Row, Col, Button } from "react-bootstrap"

export default () => {
  return (
    // <div className="component first-component">
    //   <div >
    <Container style={{ alignContent: 'center', justifyContent: 'center' }}>
      <Row>
        <h1>แล้วคุณหล่ะ?</h1>
      </Row>
      <Row>
        <Form>
          <FormGroup controlId="formBasicEmail" style={{}}>
            <FormLabel bsSize="lg">Email address</FormLabel>
            <FormControl bsSize="lg" type="email" placeholder="Enter email" />
            <FormText className="text-muted">
              We'll never share your email with anyone else.
          </FormText>
          </FormGroup>
          <FormGroup controlId="formBasicPassword">
            <FormLabel>Password</FormLabel>
            <FormControl bsSize="lg" type="password" placeholder="Password" />
          </FormGroup>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </Row>
    </Container >
    //   </div>
    // </div>
  );
};
